    let nbreInput = document.querySelector("#nbreInput");
    inputRange.addEventListener("input", e => {
      console.log(e);
    });
  });

  return (
    <>
      <input type="range" name="" id="nbreInput" min="2" max="10" value="4" />
      <input type="text" name="" id="" value="21" readOnly />
    </>
  );
};

export default App;
